    export default {
        name: "attrList",
        props:{
			attrs: {
			  type: Array,
			  default: function () {
			    return [];
			  }
			}
        },
        data(){
            return {
            }
        },
        mounted() {
        },
        methods:{
			selectAttr(label,index){
				label.select = !label.select;
				this.$emit('activeData',JSON.parse(JSON.stringify(this.attrs)))
			},
			cancel(){
				this.$emit('close')
			},
			reset(){
				let data = this.attrs;
				data.map(el=>{
					el.details.map(label=>{
						label.select = false
					})
				})
				this.attrs = data;
			},
			subBtn(){
				this.$emit('subAttrs')
			}
        }
    }
